import React from 'react'
import './Navbar.css'

class Navbar extends React.Component{
    render(){
        return (
            <div className="navBar">
            <img src="evaluate_logo.png"></img>
            <div className="navItems"><p>item 1</p></div>
            <div className="navItems"><p>item 2</p></div>
            <div className="navItems"><p>item 3</p></div>
            </div>  
        )
    }
}

export default Navbar;
